import { Link } from "react-router-dom";
import PropTypes from "prop-types";
import { connect } from "react-redux";
import { deleteProduct } from "../ProductActions/ProductActions";
class Tableitem extends Component {
  render() {
    const { table } = this.props;
    return (
      <tr className="even pointer">
        <td className="a-center ">{table.productName}</td>
        <td className="a-center ">{table.quantity}</td>
        <td className="a-center ">{table.price}</td>
        <td className="a-center ">{table.stock}</td>
        <td className="a-center ">{table.codeBar}</td>
        <td>
          <Link to={`/updatetable/${table.id}`}>Modify</Link> <br />
          <Link onClick={this.onDeleteClick.bind(this, table.id)}>
            {" "}
            Delete{" "}
          </Link>
        </td>
      </tr>
    );
  }
}

export default connect(null, {})(Tableitem);
